INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (0, 1, 8, 40000, 36, 0, 0, 91002, "", 100, "");
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (107501, 1, 8, 40001, 37, 0, 1, 91002, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 150, "ぺコリーヌ");
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (107601, 2, 8, 40001, 38, 0, 1, 91002, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 150, "コッコロ");
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (107801, 3, 8, 40001, 39, 0, 1, 91002, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 150, "キャル");
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (107701, 4, 8, 40001, 40, 0, 1, 91002, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 150, "スズメ");
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (107901, 5, 8, 40001, 41, 0, 1, 91002, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 150, "タマキ");
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (107501, 6, 8, 40001, 42, 0, 2, 91002, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 150, "ぺコリーヌ");
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (107601, 7, 8, 40001, 43, 0, 2, 91002, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 150, "コッコロ");
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (107801, 8, 8, 40001, 44, 0, 2, 91002, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 150, "キャル");
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (107701, 9, 8, 40001, 45, 0, 2, 91002, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 150, "スズメ");
INSERT INTO `v1_0b0294c996d9a0bcebb64f535bf39cdc49691fbc4d2de478dc4e02aeb389d8c0` VALUES (107901, 10, 8, 40001, 46, 0, 2, 91002, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 150, "タマキ");
